// Inside Cart.js

import React from 'react';

const Cart = ({ cartProp }) => {
  // Access cart data from received prop

  return (
    <div>
      <h2>Your Cart</h2>
      {cartProp && cartProp.length > 0 ? (
        <ul>
          {cartProp.map((stock) => (
            <li key={stock.ticker}>
              {stock.ticker} - {stock.price}
            </li>
          ))}
        </ul>
      ) : (
        <p>Your cart is empty.</p>
      )}
    </div>
  );
};

export default Cart;
